import React from 'react';


function MyAbout (){
    return (
        <div>
        <div>
            <h1>About LePanierLocal</h1>
            <p>
            Sur ce site vous retrouverez l'ensemble des commercants de votre ville? Profitez de vos commerces de proximité... !</p>
        </div>
    <div>
<p>Restez informé(e) des évènements dans votre ville</p>
    </div>

    <div>
        <p>Créer votre liste de commerce préférés pour les retrouver en un seul clic... !</p>
    </div>
    </div>
    )
};
export default MyAbout;
